import "./header.css"
import Navbar from "../navbar/Navbar";
import React from 'react'
import {Typography} from '@material-ui/core';

function Header() {
  return (
    <div style={{backgroundColor: "grey"}}>
      <Typography style={textColor} align='center' variant='h5'>Zeiterfassung HdM WebApp</Typography>
    </div>
  )
}

const textColor = {
	color: "white"
}


export default Header;
